@joyridemovie early access screenings start tonight! Tickets on sale now. In Theaters Everywhere July 7. 

We’ve got 20 tickets to give away so you and a friend can see @joyridemovie before everyone else does. 

Getting them is easy: tag your #joyrideordie bestie in the comments and we’ll pick 10 winners at random to go see it before it releases in theaters July 7th! 🙌

Get into the holiday spirit at the @BobaGuys Market Holiday Music event with live music and boba!
Join us at Boba Guys Market Holiday Music for a festive celebration! Get ready to sip on your favorite boba while enjoying live holiday music. This in-person event will be held at Boba Guys Burlingame located at Boba Guys Burlingame at 1212 Donnelly Avenue in Burlingame, CA.
Immerse yourself in the holiday spirit and groove to the cheerful tunes. Don’t miss out on this merry gathering!
Please arrive early to find parking and a seat for the event. We also invite you to the Boba Guys Holiday Market from 3P-6P featuring all local small businesses!
